  const { posts: { results }, update, history } = post
  console.log(update)
  const values = {}
  console.log(results)
  const indi = () => {
    return _.map(results, post => {
      return (
        <div className='col-md-4 ledum border p-3 col-lg-4' onClick={() => { history.push(`/posts/${post.pk}`) }} key={post.pk}>
          <img className='App-log h-100 w-100' src={logo} />
          <div>
            {post.name}
            <span className='badge badge-secondary float-right' onClick={() => { alert('Clicked') }}>Like</span>
          </div></div>
      )
    })
  }
  console.log(indi())
  return (
    <div className='row'>
      {indi()}
    </div>
  )
}

